import { NavLink } from 'react-router-dom';
import './Component.css';

import collageImg from './images/collage.jpeg';

let type = [collageImg,collageImg,collageImg];
function Component(props){
    let name = props.name;
    let pathName ="/";
    let d = collage;
    if(name=="collage")
    {
        d=type[0];
        pathName="/collage";
    }else if(name=="scrolling")
    {
        d=type[1];
        pathName="/scrolling";
    }else
    {
        d=type[2];
        pathName="/carousel";
    }
    return (
        <div className='component'>
            <img src={d} alt='photo'></img>
            <a href='./collage'>{name}</a>
        </div>
    );
}
export default Component;
